            animation-delay: 0.6s;
        }

        .fadeIn.third {
            -webkit-animation-delay: 0.8s;
            -moz-animation-delay: 0.8s;
            animation-delay: 0.8s;
        }

        .fadeIn.fourth {
            -webkit-animation-delay: 1s;
            -moz-animation-delay: 1s;
            animation-delay: 1s;
        }

        /* Simple CSS3 Fade-in Animation */
        .underlineHover:after {
            display: block;
            left: 0;
            bottom: -10px;
            width: 0;
            height: 2px;
            background-color: #56baed;
            content: \"\";
            transition: width 0.2s;
        }

        .underlineHover:hover {
            color: #0d0d0d;
        }

        .underlineHover:hover:after {
            width: 100%;
        }


        /* OTHERS */

        *:focus {
            outline: none;
        }

        #icon {
            width: 60%;
        }
    </style>
{% endblock %}
{% block body %}

    <div class=\"wrapper fadeInDown\">
        <div id=\"formContent\">
            <!-- Tabs Titles -->

            <!-- Icon -->
            <div class=\"fadeIn first\">
                <h5>Login </h5>
            </div>
            {% if error %}
                <div class=\"alert alert-danger\">
                    {{ error.messageKey|trans(error.messageData, 'security') }}</div>
            {% endif %}

            <!-- Login Form -->
            <form action=\"{{ path('app_login') }}\" method=\"post\">
                <input type=\"email\" id=\"_username\" class=\"fadeIn second\" name=\"_username\" placeholder=\"login\">
                <input type=\"password\" id=\"_password\" class=\"fadeIn third\" name=\"_password\" placeholder=\"password\">
                <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">
                <input type=\"submit\" class=\"fadeIn fourth\" value=\"Log In\">
            </form>
            <div id=\"formFooter\">
                <a class=\"underlineHover\" href=\"{{ path('app_register') }}\">Create Account</a>
            </div>

        </div>
    </div>

    {# </div> #}

{% endblock %}
